import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { Button, Card, Container, Row, Col, Alert } from 'react-bootstrap'; // Bootstrap components

const Dashboard = () => {
  const [message, setMessage] = useState('');
  const [clubs, setClubs] = useState([]);
  const [events, setEvents] = useState([]);
  const [resources, setResources] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      // Fetch User-Specific Data (Clubs, Events, Resources)
      axios
        .get('http://localhost:8000/dashboard', {
          headers: { Authorization: `Bearer ${token}` },
        })
        .then((response) => {
          setMessage(response.data.message);

          // Fetch User Clubs
          axios.get('http://localhost:8000/clubs', {
            headers: { Authorization: `Bearer ${token}` },
          }).then((clubResponse) => {
            setClubs(clubResponse.data.clubs);
          }).catch((err) => {
            console.log(err);
          });

          // Fetch User Events
          axios.get('http://localhost:8000/events', {
            headers: { Authorization: `Bearer ${token}` },
          }).then((eventResponse) => {
            setEvents(eventResponse.data.events);
          }).catch((err) => {
            console.log(err);
          });

          // Fetch User Resources
          axios.get('http://localhost:8000/resources', {
            headers: { Authorization: `Bearer ${token}` },
          }).then((resourceResponse) => {
            setResources(resourceResponse.data.resources);
          }).catch((err) => {
            console.log(err);
          });

        })
        .catch(() => {
          setMessage('Access denied. Please log in.');
        });
    } else {
      setMessage('Access denied. Please log in.');
    }
  }, []);

  // Handle Logout
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <Container className="mt-5">
      <h1 className="text-center mb-4">Dashboard</h1>

      {/* Message */}
      {message && <Alert variant="info">{message}</Alert>}

      {/* View All Clubs, Events, Resources Buttons */}
      <div className="text-center mb-4">
        <Button variant="primary" onClick={() => fetchAllClubs()}>View All Clubs</Button>
        <Button variant="success" className="mx-2" onClick={() => fetchAllEvents()}>View All Events</Button>
        <Button variant="warning" onClick={() => fetchAllResources()}>View All Resources</Button>
      </div>

      {/* Clubs Section */}
      <h2 className="mt-4">All Clubs</h2>
      <Row>
        {clubs.map((club) => (
          <Col key={club.club_id} sm={12} md={6} lg={4}>
            <Card className="mb-4">
              <Card.Body>
                <Card.Title>{club.club_name}</Card.Title>
                <Card.Text>{club.description}</Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      {/* Events Section */}
      <h2 className="mt-4">All Events</h2>
      <Row>
        {events.map((event) => (
          <Col key={event.event_id} sm={12} md={6} lg={4}>
            <Card className="mb-4">
              <Card.Body>
                <Card.Title>{event.event_name}</Card.Title>
                <Card.Text>{event.event_description}</Card.Text>
                <Card.Text><strong>Date:</strong> {new Date(event.event_date).toLocaleString()}</Card.Text>
                <Card.Text><strong>Location:</strong> {event.location}</Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      {/* Resources Section */}
      <h2 className="mt-4">All Resources</h2>
      <Row>
        {resources.map((resource) => (
          <Col key={resource.resource_id} sm={12} md={6} lg={4}>
            <Card className="mb-4">
              <Card.Body>
                <Card.Title>{resource.title}</Card.Title>
                <Card.Text><strong>Type:</strong> {resource.type}</Card.Text>
                <Card.Text><strong>Uploaded on:</strong> {new Date(resource.upload_date).toLocaleString()}</Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      {/* Actions */}
      <div className="text-center mt-5">
        <Button variant="danger" onClick={handleLogout}>Logout</Button>
      </div>
    </Container>
  );
};

export default Dashboard;
